nism/gcmtC201006150426A/us/1478744975684/contents.xml","sha256":"ABhLiaqdYWmIak24eD/csBAWouBShhatD9bUzLNEZFk="},"quakeml.xml":{"contentType":"application/xml","lastModified":1478744975000,"length":2262,"url":"https://earthquake.usgs.gov/product/focal-mechanism/gcmtC201006150426A/us/1478744975684/quakeml.xml","sha256":"/1sN9ZhwO1h9D44STEWp2rY+aHF/YDt8dwcH0THLHzk="}}},{"indexid":"9576025","indexTime":1609381637539,"id":"urn:usgs-product:us:focal-mechanism:choy20100615042658:1435683543711","type":"focal-mechanism","code":"choy20100615042658","source":"us","updateTime":1435683543711,"status":"UPDATE","properties":{"beachball-source":"us","evaluation-status":"preliminary","eventParametersPublicID":"quakeml:us.anss.org/eventparameters/10002l37/1435063121","eventsource":"choy","eventsourcecode":"20100615042658","nodal-plane-1-dip":"80","nodal-plane-1-rake":"5","nodal-plane-1-strike":"35","nodal-plane-2-dip":"85","nodal-plane-2-rake":"170","nodal-plane-2-strike":"304","original-signature":"MC0CFQDUIZ6B2008FO1H+9KcO0Iie2nuAAIUYfhMPutcUMq+J05lPsD+pSRd3xs=","original-signature-version":"v1","quakeml-publicid":"choy20100615042658","review-status":"automatic"},"preferredWeight":3,"contents":{"contents.xml":{"contentType":"application/xml","lastModified":1435684804000,"length":195,"url":"https://earthquake.usgs.gov/product/focal-mechanism/choy20100615042658/us/1435683543711/contents.xml","sha256":"ABhLiaqdYWmIak24eD/csBAWouBShhatD9bUzLNEZFk="},"quakeml.xml":{"contentType":"application/xml","lastModified":1435683543000,"length":2776,"url":"https://earthquake.usgs.gov/product/focal-mechanism/choy20100615042658/us/1435683543711/quakeml.xml","sha256":"bPfhzyTUwK26+vJHp4yiadJrXRahpf96NaX4S2tROGI="}}}],"general-text":[{"indexid":"9476572","indexTime":1609371157092,"id":"urn:usgs-product:admin:general-text:usp000he04-1455049666520:1455049722277","type":"general-text","code":"usp000he04-1455049666520","source":"admin","updateTime":1455049722277,"status":"UPDATE","properties":{"eventsource":"us","eventsourcecode":"p000he04","original-signature":"MCwCFEXq687pZjGiABUoGd2RIl9tgWlRAhRoJFcILd6J3z9P3rB7J0UMW/6F4Q==","original-signature-version":"v1","review-status":"Reviewed","senderemail":""},"preferredWeight":1,"contents":{"":{"contentType":"1","lastModified":1455049722000,"length":1640,"bytes":"<h2>Tectonic
        Summary</h2>\n\n<p>\nA M5.7 aftershock to the M7.2 April, 4th 2010 Easter
        Sunday mainshock, called El Mayor-Cucapah earthquake, occurred at 9:27 pm
        (Western Standard Time) on June 14th, about 5 miles southeast of the Imperial
        County community of Ocotillo, at the US Mexico border. This aftershock was
        the largest so far of the M7.2 El Mayor-Cucapah sequence. This aftershock
        was located within the large cluster of aftershocks at the northwest end of
        the ongoing aftershock sequence. The M5.7 event was followed by its own vigorous
        aftershock sequence, with four M4+ and 35 M3 to M4 events, during the first
        12 hours.\n</p>\n<p>\nThe M5.7 June 14th event probably occurred on a northwest
        striking fault that follows the trend of the Elsinore fault in this region.
        The Elsinore fault is more than 110 miles long, and extends into the Orange
        County and Los Angeles area as the Whittier fault. The Elsinore fault is capable
        of a major earthquake that would significantly affect the large metropolitan
        areas of southern California. The Elsinore fault has not hosted a major earthquake
        in more than 100 years.\n</p>\n<p>\nThe occurrence of this aftershock and
        its own aftershock sequence, and the M4.9 earthquake that occurred along the
        San Jacinto fault on June 12th 2010 demonstrate that the earthquake activity
        in the region remains at an elevated level. The San Jacinto fault is known
        as the most active earthquake fault in southern California. Caltech and USGS
        seismologist continue to monitor the on going earthquake activity using the
        Caltech/USGS Southern California Seismic Network and a GPS network of more
        than 100 stations.\n</p>\n","sha256":"H/62DNLBDb7KGYjBi7II4vssjBv67yfUSN8Ni/a8sbQ="}}}],"impact-text":[{"indexid":"13219256","indexTime":1610454757921,"id":"urn:usgs-product:us:impact-text:usp000he04:1415324501091","type":"impact-text","code":"usp000he04","source":"us","updateTime":1415324501091,"status":"UPDATE","properties":{"eventParametersPublicID":"quakeml:US.anss.org/eventParameters/pde20100615042658480_5/1415324501091","eventsource":"us","eventsourcecode":"p000he04"},"preferredWeight":8,"contents":{"":{"contentType":"text/plain","lastModified":1415324501000,"length":654,"bytes":"Some
        buildings slightly damaged (VII) at Ocotillo. Felt (V) at Calipatria, Campo,
        El Centro, Holtville and Jacumba and (IV) in the Anza-Brawley-San Diego area.
        Felt throughout Imperial, Los Angeles, Orange, Riverside and San Diego Counties
        and in parts of Kern, San Bernardino, Santa Barbara and Ventura Counties.
        Felt (V) at El Sauzal and (IV) at Ensenada, Mexicali, Rosarito, Tecate and
        Tijuana, Baja California. Felt in much of northern Baja California. Felt (III)
        at San Luis Rio Colorado, Sonora. Also felt at Puerto Penasco. Felt (III)
